@Test
func InlineMT19937() {
    let uuid = UUID()

    var generator = MT19937RandomGenegator(uuid: uuid)
    var fast_generator = InlineMT19937RandomGenegator(uuid: uuid)

    for _ in 0 ..< 10000 {
        #expect(generator.next() == fast_generator.next())
    }
}
